import { Paper, TextField } from "@material-ui/core";
import React from "react";

function FormArea() {
  return (
    <Paper style={{ margin: "10px 10px", padding: "25px 50px" }}>
      <form>
        <TextField />
      </form>
    </Paper>
  );
}

export default FormArea;
